import { useState, useEffect } from "react"
import { useNavigate, useParams } from "react-router-dom"
import "./BookingForm"

export const MyRequest = () => {

    const { requestId } = useParams()

    const localFatBackUser = localStorage.getItem("fatback_user")
    const fatbackUserObject = JSON.parse(localFatBackUser)

    const [requests, setRequest] = useState([])
    // const [client, setClients] = useState({})
    const navigate = useNavigate()

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests?_expand=genre&userId=${fatbackUserObject.id}`)
                .then(response => response.json())
                .then((requestInfo) => {
                    setRequest(requestInfo)
                })
        }, []
    )


    const handleEditButtonClick = (event, request) => {
        event.preventDefault()

        navigate(`/myrequest/${request}`)

    }


    // const deleteButton = () => {

    //     return <button
    //         onClick={() =>
    //             fetch(`http://localhost:8088/requests?_expand=genre&userId=${fatbackUserObject.id}`, {
    //                 method: "DELETE"
    //             })

    //                 .then(() => {
    //                     navigate(`/home`)
    //                 })
    //         }
    //         className="deleteButton">
    //         Delete Request</button>

    // }

    // const handleDeleteButtonClick = (event) => {
    //     event.preventDefault()

    //     return fetch(`http://localhost:8088/requests?_expand=genre&userId=${fatbackUserObject.id}`, {
    //         method: "DELETE",
    //         headers: {
    //             "Content-Type": "application/json",
    //         },

    //     })


    //         .then(() => {
    //             navigate("/myrequest")
    //         })

    // }


    return (
        <div className="myrequest">



            <>{requests.length ?
                <div key={`requests--${requests.id}`}>
                    <h2 className="requestHeader">My Request</h2>
                    {requests.map(request => {
                        return (<>
                            <div className="requestInfo" key={requestId}>
                                <div key={`request--${request.bandName}`}>Band Name: {request.bandName}</div>
                                <div key={`request--${request.phoneNumber}`}>Phone Number: {request.phoneNumber}</div>
                                <div key={`request--${request.startDate}`}>Start Date: {request.startDate}</div>
                                <div key={`request--${request.endDate}`}>End Date: {request.endDate}</div>
                                <div key={`request--${request.numOfSongs}`}>No. of Songs: {request.numOfSongs}</div>
                                <div>Genre: {request?.genre?.type}</div>

                                <div className="radioReview">Musicians:
                                    <> {request.musicianRequest === true ?
                                        <div>Yes</div> :
                                        <div>No</div>
                                    }
                                    </>
                                </div>

                                <div className="radioReview">Session Musicians:
                                    <> {request.sessionMusicians === true ?
                                        <div>Yes</div> :
                                        <div> No</div>
                                    }
                                    </>
                                </div>

                                <div className="radioReview">Photos:
                                    <> {request.photoRequest === true ?
                                        <div>Yes</div> :
                                        <div>No</div>
                                    }
                                    </>
                                </div>

                                <div className="radioReview">Video Request: 
                                    <> {request.videoRequest === true ?
                                        <div>Yes</div> :
                                        <div>No</div>
                                    }
                                    </>
                                </div>
                            </div>
                            <div className="button">
                                <button
                                    onClick={(clickEvent) => { handleEditButtonClick(clickEvent, request.id) }}
                                    className="editButton">
                                    Edit Request
                                </button>

                                {/* {deleteButton()} */}

                            </div></>)
                    })}
                </div> :
                <div>NO REQUESTS...</div>
            }</>

        </div >

    )
}
